Ambiance and food are top notch.
Great date spot.', u'author_name': u'R Honovic', u'author_url': u'https://plus.google.com/104682696915466644113', u'time': 1461446927}, {u'rating': 2, u'aspects': [{u'rating': 0, u'type': u'overall'}], u'language': u'en', u'text': u'If you like exactly what's on the menu you'll do fine. BUT if you have any problems with the meal as it appears don't bother. Totally unaccomidating chef. Allergies and taste be damned.', u'author_name': u'Trina Sultan', u'author_url': u'https://plus.google.com/110172789880621660499', u'time': 1460858133}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-4Ed9YeBzNn8/AAAAAAAAAAI/AAAAAAAAJK8/AA2yqipdeKM/photo.jpg', u'language': u'en', u'text': u'Manhattan food quality and service at Brooklyn prices. One of the best in New York City, hands down. Plus, in a quaint and charming neighborhood called Carols Garden which is an absolute delight to walk thru. 15 mins from Soho this place was worth it.  Dover....don't become complacent!!!!', u'author_name': u'Erik Warner', u'author_url': u'https://plus.google.com/117332187180358219842', u'time': 1443307060}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-EdbM7i7Yt5Y/AAAAAAAAAAI/AAAAAAAAHQA/ALugmMquLhs/photo.jpg', u'language': u'en', u'text': u'Crispy chicken is awesome. So is the bacon.', u'author_name': u'Filip Bortkiewicz', u'author_url': u'https://plus.google.com/100178172365747340669', u'time': 1449961798}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'language': u'en', u'text': u'Outstanding! Not a single misstep. Beautiful, creative food, in a casual setting with excellent service.', u'author_name': u'Richard Schwartz', u'author_url': u'https://plus.google.com/101504864069437015525', u'time': 1439040563}], u'formatted_phone_number': u'(347) 987-3545', u'address_components': [{u'long_name': u'412', u'types': [u'street_number'], u'sho