{u'website': u'http://www.rosesbklyn.com/', u'rating': 4, u'utc_offset': -240, u'name': u'Rose's', u'reference': u'CmRaAAAAEnnquzK-Nm0dQMTuFr0ZGzzrLZVBB57eNFbwW2m3JRZ7NPDxi59uFiKfSkZJtdnI7bAMNjZ59tGBqfG0p0k4YrnM_beHpYi5kXK-4mbbjYaCeIxVDFwo7DGBl7bODldJEhBHnWMJQrWVA7XJ7_1NxHxBGhQ1QRDmRC_A_MwxdGCtGnSKS3M06A', u'price_level': 2, u'geometry': {u'location': {u'lat': 40.6789834, u'lng': -73.9734269}, u'viewport': {u'northeast': {u'lat': 40.67903994999998, u'lng': -73.97329939999999}, u'southwest': {u'lat': 40.67881375, u'lng': -73.9738094}}}, u'adr_address': u'<span class="street-address">295 Flatbush Ave</span>, <span class="locality">Brooklyn</span>, <span class="region">NY</span> <span class="postal-code">11217</span>, <span class="country-name">USA</span>', u'place_id': u'ChIJYcr4z6hbwokRCJzk0UHRm4A', u'international_phone_number': u'+1 718-230-0427', u'vicinity': u'295 Flatbush Avenue, Brooklyn', u'reviews': [{u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-C04MLjWp0QM/AAAAAAAAAAI/AAAAAAAAAhU/QHgcnfTKMmM/photo.jpg', u'language': u'en', u'text': u'Great drinks, laid back vibe, good service', u'author_name': u'Steven Schulberg', u'author_url': u'https://plus.google.com/106261087127642958913', u'time': 1458237763}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-uPVQi5bGFXI/AAAAAAAAAAI/AAAAAAAAAH8/HqCezF3EuVg/photo.jpg', u'language': u'en', u'text': u'Went here for dinner and had great food. Had the pork which was described as "spitted", which I took to mean spit roasted. The portion I received consisted of two shoulder chops served with a side of greens. The pork was outstanding! It was moist and had a tangy, vinegary flavor but no obvious sauce was served with it. I assume it was brined as it was amazingly moist and the flavor was superb. The greens complemented the pork very well. A fruity side would have worked nicely too. 

My dinner companions both had burgers, which I also tasted. They said they were delicious and I agree. Moist and served as ordered (medium rare) on a toasted bun.  Good size, juicy and perfectly cooked. They were served essentially plain with ketchup on the side but no lettuce or other garnishes. (Personally I would like some tomato and slice of onion on mine.) The burgers were served with a side of fries which were excellent, fries to a crispy stage and well salted. 

Overall ambiance is a 3.5-4 range. Nothing special but OK. Nice looking bar and outside eating area at this time of year which looked nice. Prices were high-ish but not out of line with other places in that quality level and area.  Good beer list which also seems to go well with the menu options. There were some interesting cocktail choices as well, which we didn't try this time. I look forward to returning. ', u'author_name': u'Kate Kosche', u'author_url': u'https://plus.google.com/107535386740478019534', u'time': 1435890454}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-EdbM7i7Yt5Y/AAAAAAAAAAI/AAAAAAAAHQA/ALugmMquLhs/photo.jpg', u'language': u'en', u'text': u'Best cheeseburger in the area. Nice to sit out back outside.', u'author_name': u'Filip Bortkiewicz', u'author_url': u'https://plus.google.com/100178172365747340669', u'time': 1448123957}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'language': u'en', u'text': u'', u'author_name': u'nina rosenquest', u'author_url': u'https://plus.google.com/113765066289651562119', u'time': 1462298383}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-5w_yW9sMVlk/AAAAAAAAAAI/AAAAAAAAAbY/FCU2f4pSdwc/photo.jpg', u'language': u'en', u'text': u'', u'author_name': u'Kaitlin Firstbrook', u'author_url': u'https://plus.google.com/103260004576572805685', u'time': 1459953420}], u'formatted_phone_number': u'(718) 230-0427', u'scope': u'GOOGLE', u'url': u'https://maps.google.com/?cid=9267230738869427208', u'opening_hours': {u'weekday_text': [u'Monday: 5:30 – 11:00 PM', u'Tuesday: 5:30 – 11:00 PM', u'Wednesday: 5:30 – 11:00 PM', u'Thursday: 5:30 – 11:00 PM', u'Friday: 5:30 – 11:00 PM', u'Saturday: 12:00 – 11:00 PM', u'Sunday: 12:00 – 10:00 PM'], u'open_now': False, u'periods': [{u'close': {u'day': 0, u'time': u'2200'}, u'open': {u'day': 0, u'time': u'1200'}}, {u'close': {u'day