t': {u'lat': 40.72211665000001, u'lng': -73.98749049999999}}}, u'adr_address': u'<span class="street-address">205 E Houston St</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10002</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-254-2246', u'reviews': [{u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-Fgs2nTUkLu8/AAAAAAAAAAI/AAAAAAAAAkg/MNA3DnkWk0s/photo.jpg', u'language': u'en', u'text': u'I'm from Chicago and was brought there without any advance warning. Other than the place being packed and needing 10 minutes to order, everything was wonderful. Corned beef, pastrami, brisket all excellent and steak fries crispy. Can't say anything bad about the food. Would definitely go back.', u'author_name': u'Phil Ko', u'author_url': u'https://plus.google.com/102602931803678675016', u'time': 1466918020}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-vO_O6ofXsvE/AAAAAAAAAAI/AAAAAAAAAaI/ZQvamNoHihU/photo.jpg', u'language': u'en', u'text': u'Deli-cious sandwich! I really enjoyed the sandwich, it was generous and delicious. I've been to other delis in NYC, but this was the only one where you had to take a ticket when you enter and return it the you leave otherwise you get fined (there were bouncers at the door as well). Interesting experience...', u'author_name': u'Moriam Robinson', u'author_url': u'https://plus.google.com/107324833064466232674', u'time': 1466690579}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-JmphqX8PsqI/AAAAAAAAAAI/AAAAAAAB0_o/iUlZw_IBzNM/photo.jpg', u'language': u'en', u'text': u'After the original 2nd Ave deli went away (now it's back in a new form), Katz's and Carnegie became the two remaining super traditional Jewish delis in Manhattan. Katz's sandwiches are consistently good and the quality of their meat is great. The only downside is the traditional "cafeteria ticket" format, where you have to take a ticket when you come in, you wait in what are usually extremely long and rowdy lines to get your sandwich, you wait in another line to get any sides or drinks you want, then you have to find a table, and finally you pay when you go out. This can be super chaotic and overwhelming for people, especially given how many tourists are usually there and how many of them don't understand the ticket system, but it is a "true city deli experience" that will get you an amazing sandwich in the end. They do have a small number of waiter service tables on the left side of the room where you don't have to deal with the tickets and the crazy crowds but those are usually full and require a wait. If you are scared off by the big crowds and the counter/ticket experience then go to Carnegie. ', u'author_name': u'Matt Jacobs Jr', u'author_url': u'https://plus.google.com/109211239342408282067', u'time': 1466417085}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-CwC90BjMTGg/AAAAAAAAAAI/AAAAAAAAeXQ/koby2N_TE5c/photo.jpg', u'language': u'en', u'text': u'The pastrami and roast beef sandwiches were amazing here , I did question how expensive it was though because it was almost $20 per sandwhich. After you get over how expensive it is , you'll start to understand because of how tasty it was! 

They have an interesting way of how you pay for your meal. You get a ticket from the entrance , you order your sandwhich, you eat it , then on your way out you pay with the amount listed on your ticket 

Overall cool spot lots of places to sit and a great late night dinner after a long night out! ', u'author_name': u'Richard Navarro', u'author_url': u'https://plus.google.com/102837592139129677983', u'time': 1466174166}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-rZyJzx9hdUk/AAAAAAAAAAI/AAAAAAAACDQ/wMVEyZcHBi8/photo.jpg', u'language': u'en', u'text': u'Amazing sandwiches, great service. Only downsides, long wait (as its crazy popular) and the price!  Still it's a must do if you are in New York!', u'author_name': u'Stuart Gregory', u'author_url': u'https://plus.google.com/113257306849880176576', u'time': 1466932377}], u'formatted_phone_number': u'(212) 254-2246', u'address_components': [{u'long_name': u'205', u'types': [u'street_number'], u'short_name': u'205'}, {u'long_name': u'East Houston Street', u'types': [u'route'], u'short_name': u'E Houston St'}, {u'long_name': u'Lower Manhattan', u'types': [u'neighborhood', u'political'], u'short_name': u'Lower Manhattan'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10002', u'types': [u'postal_code'], u'short_name': u'10002'}]}

