-73.98841374999999}}}, u'adr_address': u'<span class="street-address">90 3rd Ave</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10003</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-390-8685', u'reviews': [{u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-idVnjsEqtDQ/AAAAAAAAAAI/AAAAAAAAAHM/tum2fzM4I5M/photo.jpg', u'language': u'en', u'text': u'Great food, but bad experience. We ordered wings and Dan Dan noodles as starters. Noodles came out quick and were delicious. Main dishes came out. Three pots of tea... No wings. Our server checked on the wings and told us they hadn't even been started. She offered us free beers for the mistake. The check included two beers and, in the end, we paid for the beers that we ordered only because they were offered as free. 

Good recovery as the wings we took to go were delicious, even hours later. 

I recommend, but would go for take out. ', u'author_name': u'Caitlin B', u'author_url': u'https://plus.google.com/108047804135304428717', u'time': 1465271958}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-JdGttP-Hbns/AAAAAAAAAAI/AAAAAAAAAKg/bRSrDil1_JQ/photo.jpg', u'language': u'en', u'text': u'Han Dynasty is always quite busy during meal times. We went this time between lunch and dinner for quite a late lunch and we were seated right away. Although this place does take out and delivery, you're not getting your General Tso's here so don't ask. They do authentic Sichuan food and that's great. I highly recommend the Cold Sesame Noodles (yes over their great Dan Dan Noodles) and the dry pepper style chicken, the numbing sensation from the szechuan peppercorns are awesome!', u'author_name': u'Eric Kim', u'author_url': u'https://plus.google.com/110691300044441735616', u'time': 1463500352}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-_Qe6yW0RLqk/AAAAAAAAAAI/AAAAAAAAgzA/C2tL6p99kYg/photo.jpg', u'language': u'en', u'text': u'Spicy but delish sichuan cuisine. We really enjoy super fresh wontons in spicy oil, crisy chicken wings and most of all the triple fried crispy fish! ! !', u'author_name': u'Emily Bennett', u'author_url': u'https://plus.google.com/102654014712106401252', u'time': 1463535744}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-KENYwbJLgW4/AAAAAAAAAAI/AAAAAAAAVS8/SDy6uMMNOaA/photo.jpg', u'language': u'en', u'text': u'Best sichuan food in the city! Highly recommend the chicken wings, dan dan noodles, and the chicken hot pot style. Excellent spicy food but be prepared to wait for a table, they don't take reservations', u'author_name': u'Varun Chalupadi', u'author_url': u'https://plus.google.com/110087522433446620658', u'time': 1462245787}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-nNg6Zf2eSnM/AAAAAAAAAAI/AAAAAAAAIrA/mzEbnieTFek/photo.jpg', u'language': u'en', u'text': u'About half the dishes are athentic Sichuan style and the other half are strange modern fusion style. Great: peanut appetizer, Sichuan beef noodle soup, dry pepper pork. Weird: cut baozi (tons of white sugar piled on it, what the heck?).', u'author_name': u'James Trent', u'author_url': u'https://plus.google.com/112968675960495255221', u'time': 1462310281}], u'formatted_phone_number': u'(212) 390-8685', u'address_components': [{u'long_name': u'90', u'types': [u'street_number'], u'short_name': u'90'}, {u'long_name': u'3rd Avenue', u'types': [u'route'], u'short_name': u'3rd Ave'}, {u'long_name': u'East Village', u'types': [u'neighborhood', u'political'], u'short_name': u'East Village'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10003', u'types': [u'postal_code'], u'short_name': u'10003'}]}

