ex7co81W-S8bCXwOaLnIQ', u'width': 2048, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/104111246635874032234/photos">ZAGAT</a>'], u'height': 1365}, {u'photo_reference': u'CoQBcwAAAMU89mlH8lC1m1b2GmDzkBUU3ZC3HSBBgv87SZqJMl9miCtZsV0HWFXCDP_By8XEWBRYYh07bPNKGL4-MIAcw7HTCuQV0Kwl1KmjDBmqwDzoMdBHUGyz7cCaDOx6bWm4AFb6L86nZji8rFnkZcWKk46-Na2bYWPg9GwwOLuivrGdEhC1PUN5QkayEtqKzchM-2vjGhQPAo73e1KRF_LFJLzzk3Uf0v-ASA', u'width': 2048, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/104111246635874032234/photos">ZAGAT</a>'], u'height': 1365}], u'geometry': {u'location': {u'lat': 40.687792, u'lng': -74.0011473}, u'viewport': {u'northeast': {u'lat': 40.6878712, u'lng': -74.00105085}, u'southwest': {u'lat': 40.68776559999999, u'lng': -74.00143665}}}, u'adr_address': u'<span class="street-address">115 Columbia St</span>, <span class="locality">Brooklyn</span>, <span class="region">NY</span> <span class="postal-code">11201</span>, <span class="country-name">USA</span>', u'place_id': u'ChIJvRaAr1xawokRqr5eYFW3eos', u'international_phone_number': u'+1 718-797-4120', u'vicinity': u'115 Columbia Street, Brooklyn', u'reviews': [{u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-tQCc6uWm1Jw/AAAAAAAAAAI/AAAAAAABYto/ROiIpkddCZc/photo.jpg', u'language': u'en', u'text': u'Waiting to try Pok Pok, the owner had a brilliant idea. We can have a second waiting bar across the street with food while they wait to eat across the street. The ‘thai style’ street food is a good concept. I even like the food and service. Our bartender was friendly but tired. There was one Asian in the place and it was me. The dried squid with dipping sauce was like what my dad ate with his buddies while drinking beer. The tamarind eggs was familiar as I use to eat it all the time as a child with rice for dinner. It was a favorite of mine. The grilled baby octopus was also equally as good with the spicy dipping sauce.

I think what perturbs me is that he made it sounded like such an innovation to have this to ‘reduce’ the long waiting but really is more like double dipping when all they really had to do was accept reservations.  A potentially $100-120 meal ‘thai street’ food for two people is a bit extortive.', u'author_name': u'D Nguyễn', u'author_url': u'https://plus.google.com/115933623080364545130', u'time': 1402519593}, {u'rating': 2, u'aspects': [{u'rating': 0, u'type': u'overall'}], u'language': u'en', u'text': u'I went here to have a drink while waiting for friends to meet for dinner across the street. I ordered an old fashioned.  I ordered Michter's bourbon (and not the 10 yr), a good but not extravagant bourbon.  The bourbon was $14.  There was a $4 charge for it to be made into an old fashioned.  Plus tax and a begrudged $1 tip meant the simple drink was $21.  I thought that was utterly ridiculous .  It tasted nice though.

Sorry that singular incident was my first impression of the place but it's enough that it will be my only impression. :/', u'author_name': u'Adam Paiva', u'author_url': u'https://plus.google.com/113804557788826443218', u'time': 1416079566}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-_kLrhqkUPwE/AAAAAAAAAAI/AAAAAAAAAE8/9R2Ojf8ZIYE/photo.jpg', u'language': u'en', u'text': u'Had the LORD BERGAMOT here while waiting for my pok pok table. The drink features one of my favorite earl gray teas, lord bergamot from smith street in portland. The staff seemed to be in control of the crowd size. However, don't be surprised if the place is full  because everyone is waiting 2 hours for a table next store. It seems they do serve some light fare at this place if you need a little something to get you through the wait.', u'author_name': u'Christopher Westendorf', u'author_url': u'https://plus.google.com/108514953766748224930', u'time': 1393276345}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-6RwsXisLVeA/AAAAAAAAAAI/AAAAAAAAjG4/Pj7qNOCX2x0/photo.jpg', u'language': u'en', u'text': u'Late night happy hour is pretty solid. The tamarind whiskey sour is a good house drink, really fairly priced, too. And, Evil Twin on tap = late night happiness. ', u'author_name': u'Ryan Kotler', u'author_url': u'https://plus.google.com/100302077057873804644', u'time': 1398624216}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-k6gyPlaDV04/AAAAAAAAAAI/AAAAAAAACVc/El1Q4DP1SHQ/photo.jpg', u'language': u'en', u'text': u'', u'author_name': u'Christen B. Adkins', u'author_url': u'https://plus.google.com/114839977660464548160', u'time': 1416635694}], u'formatted_phone_number': u'(718) 797-4120', u'types': [u'bar', u'point_of_interest', u'establishment'], u'scope': u'GOOGLE', u'url': u'https://m