99999999, u'lng': -73.99846095}}}, u'adr_address': u'<span class="street-address">80 Spring St</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10012</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-965-1414', u'reviews': [{u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-qO7vCHHAkmY/AAAAAAAAAAI/AAAAAAAAAD4/DG4okc3JykI/photo.jpg', u'language': u'en', u'text': u'One of my NYC favorites, if in the city you have to go. The ambience and atmosphere are unique. Everything is delicious, the French onion sup is superb. The staff is great, it is nearly impossible to find a table if you don't book in advance but the host will always do his/her best to accommodate you, even if you have to wait maybe 1 or 2 hours walking around the neighborhood (MoMA store in front of the restaurant and Soho shops will kill time fast! :)', u'author_name': u'Enrique NYC Madrid', u'author_url': u'https://plus.google.com/108188156897862673778', u'time': 1465609146}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-dNBDG7HiVYU/AAAAAAAAAAI/AAAAAAAAADc/_Nby80CJjVM/photo.jpg', u'language': u'en', u'text': u'Our first time at Balthazar was fantastic! I had one of the specials, the grilled dorade, and it was amazing. Our host Austin was really friendly. Great restaurant to go to for people watching. Can't wait to come back next time we're in New York!', u'author_name': u'Derek Guenther', u'author_url': u'https://plus.google.com/109385880610262653005', u'time': 1464455350}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-lgmnTWoGWrE/AAAAAAAAAAI/AAAAAAAACU8/3lfhvW1lIWA/photo.jpg', u'language': u'en', u'text': u'Definitely overrated place. I've seen better breakfast and brunch menus. 

If I go there again it will be for the ambience and not the food. 

Not fan of the staff. Am not saying they were bad or rude though. ', u'author_name': u'Mohamed I. Al-Sahlawi', u'author_url': u'https://plus.google.com/101700381898117327968', u'time': 1462998972}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-Kekp5v8jous/AAAAAAAAAAI/AAAAAAAAAl8/syUOiQC1rcQ/photo.jpg', u'language': u'en', u'text': u'Balthazar has been a New York staple for years, but it might now be bordering on tourist attraction. The atmosphere is classic French bistro but the prices are a bit more "upscale." Everything is good.', u'author_name': u'Dean Praetorius', u'author_url': u'https://plus.google.com/103347174328293237566', u'time': 1465156259}, {u'rating': 2, u'aspects': [{u'rating': 0, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-bsFt392u0EY/AAAAAAAAAAI/AAAAAAAAHlo/tXcfaqOGIbA/photo.jpg', u'language': u'en', u'text': u'A highly overrated place. It's guaranteed you'll always wait quite a bit to get seated. The staff is not the friendliest. They're kinda cocky. The food is not that great and worth the money. I paid 25$ for a tiny, small plate of eggs florentine. Its not worth the big bill. ', u'author_name': u'Emir Cetinel', u'author_url': u'https://plus.google.com/107515784006053437454', u'time': 1463416077}], u'formatted_phone_number': u'(212) 965-1414', u'address_components': [{u'long_name': u'80', u'types': [u'street_number'], u'short_name': u'80'}, {u'long_name': u'Spring Street', u'types': [u'route'], u'short_name': u'Spring St'}, {u'long_name': u'Lower Manhattan', u'types': [u'neighborhood', u'political'], u'short_name': u'Lower Manhattan'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'],