rk</span>, <span class="region">NY</span> <span class="postal-code">10003-2963</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 646-767-9050', u'reviews': [{u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-JdGttP-Hbns/AAAAAAAAAAI/AAAAAAAAAKg/bRSrDil1_JQ/photo.jpg', u'language': u'en', u'text': u'Oiji has been consistently on Eater NY's list of essential 38 restaurants for a while. It's a pretty small space and reservations are made over the phone. I came here with my family, my wife, parents, and brother, for Mother's Day. I am Korean and this place is heralded as the place that's elevating and increasing accessibility to traditional Korean food in the competitive world that is the NYC restaurant space. My parents don't frequent these kind of institutions, but are excellent cooks at making traditional food. They had enjoyed the dishes, but felt that is was a fusion more than elevated traditional cuisine. I would agree with them. While nothing was bad, as someone who was born in Korea and lived there for a decade before moving to the States, I felt I was paying a lot for Korean food that didn't always capture the heart of the food even if it did capture the flavors. I would say Oiji does a better job of making traditional Korean food more accessible than elevating it, which isn't per se a bad thing.', u'author_name': u'Eric Kim', u'author_url': u'https://plus.google.com/110691300044441735616', u'time': 1463160981}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-H4370cMhYPo/AAAAAAAAAAI/AAAAAAAAIA8/NisdbpXVcVY/photo.jpg', u'language': u'en', u'text': u'Dine in the bar area, super crowded and great vibe.  Food was fantastic, had the fried chicken and even ordered seconds.  Ryan at the bar was charismatic and made our night superb.  Can't wait to return.', u'author_name': u'Valerie Forin', u'author_url': u'https://plus.google.com/103430485200653775273', u'time': 1460558035}, {u'rating': 2, u'aspects': [{u'rating': 0, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-5lVYg7pSjLM/AAAAAAAAAAI/AAAAAAAA1N4/iTryF8INIes/photo.jpg', u'language': u'en', u'text': u'Don't come here if you're vegetarian. There are only two dishes on the menu that don't include meat, and you should ask the server very particular questions because a lot of the dishes have meat or meat broth but it isn't listed on the menu.

Our table (including non-vegetarians) wasn't too impressed with the food. The portions are very small and very expensive, making a hearty dinner quite pricey. Some menu items were delicious, and others were a disappointment. For the price they're asking, everything on the menu should be superb.', u'author_name': u'Grant Beyleveld', u'author_url': u'https://plus.google.com/115141066263280017088', u'time': 1453138261}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-CSsnj8t8TJg/AAAAAAAAAAI/AAAAAAAAsu8/GWwLO0LkSyM/photo.jpg', u'language': u'en', u'text': u'Really good food, very inventive, delicious and fresh, but a little expensive. Takes reservations, and the staff is professional ', u'author_name': u'Ting Bea Yang', u'author_url': u'https://plus.google.com/100821000583474861471', u'time': 1466378152}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-TFZVIkMOxQg/AAAAAAAAAAI/AAAAAAAAADM/wormZ35J6io/photo.jpg', u'language': u'en', u'text': u'Mind-blowingly delicious New Korean, with great craft cocktails. Every dish drips with flavor – traditional base, innovative twists. Worth going for drinks alone – top-shelf soju (finally!), cocktails featuring infusions and culinary touches.
Looking forward to returning often!  ', u'author_name': u'Nils Barth', u'author_url': u'https://plus.google.com/102346264348694542519', u'time': 1457842499}], u'formatted_phone_number': u'(646) 767-9050', u'address_components': [{u'long_name': u'119', u'types': [u'street_number'], u'short_name': u'119'}, {u'long_name': u'1st Avenue', u'types': [u'route'], u'short_name': u'1st Avenue'}, {u'long_name': u'East Village', u'types': [u'neighborhood', u'political'], u'short_name': u'East Village'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10003', u'types': [u'postal_code'], u'short_name': u'10003'}, {u'long_name': u'2963', u'types': [u'postal_code_suffix'], u'short_name': u'2963'}]}

