Ps. Brussels Sprouts are a must side..', u'author_name': u'Philip G Smith', u'author_url': u'https://plus.google.com/115590273231628941476', u'time': 1459449107}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'language': u'en', u'text': u'Great execution and nice flavorful dishes.  Good Happy Hour price on the cocktail (~$8). Friendly staff getting the hang of it. Great commuting location. ', u'author_name': u'Alice Koerner', u'author_url': u'https://plus.google.com/102946855586789432828', u'time': 1455819571}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-a0O0xVugiPQ/AAAAAAAAAAI/AAAAAAAAFDo/z1Z5iLcsbGA/photo.jpg', u'language': u'en', u'text': u'Food is great, a large variety from pub food to well cooked fish. Drinks are priced right and there is plenty of space. There is even a smaller bar with couches upstairs.', u'author_name': u'Levar Jackson', u'author_url': u'https://plus.google.com/115631331635783172130', u'time': 1463251497}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-D1uGR7DLDKA/AAAAAAAAAAI/AAAAAAAAHcY/OCgUitOHXIY/photo.jpg', u'language': u'en', u'text': u'One of the best dinners I've ever had. My friend and I split the gnocchi, which was delicious. We ordered a side of Brussels sprouts. They were amazing. I look forward to going back.', u'author_name': u'Becky Curran', u'author_url': u'https://plus.google.com/106180017486514845363', u'time': 1455674453}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-xvZEAGLnx30/AAAAAAAAAAI/AAAAAAAAQ6Y/JFohxZhnc-Y/photo.jpg', u'language': u'en', u'text': u'Just stopped in for a beer. Great beer and nice staff. Clean place and I like the decór. ', u'author_name': u'Mattia Ruta', u'author_url': u'https://plus.google.com/110513094871369750742', u'time': 1457389643}], u'formatted_phone_num