on': {u'lat': 40.7341954, u'lng': -74.0064599}, u'viewport': {u'northeast': {u'lat': 40.73420424999999, u'lng': -74.00614955}, u'southwest': {u'lat': 40.73419045000001, u'lng': -74.00656335}}}, u'adr_address': u'<span class="street-address">529 Hudson St</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10014</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-792-9700', u'reviews': [{u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'language': u'en', u'text': u'It was a awesome  jazz place no doubt about it! The only reason I gave it a three star was because for the longest time we couldn't sit "next to each other " at the table. We had to sit across from each other. Mind you the place was packed! But the couple next to us and they wanted to sit across from me and my boyfriend next to each other but were denied. Later on we asked the waitress and she said sure if me and my boyfriend were ok with it. We also had reservations online already but it was still first come first serve which I didn't like. Next time we might as well just get there early no point in making a reservation online. 
 I didn't try any of there food because we already ate before going here but we did try their drinks. Not bad. We listened to an amazing band. It was just nice listen to such talent from all kinds of people and see different people from all walks of life come together and appreciate the same kind of music. :)', u'author_name': u'Jia Jack', u'author_url': u'https://plus.google.com/113519538307958046258', u'time': 1465560734}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-jjT-T-lM0Fs/AAAAAAAAAAI/AAAAAAAAAA8/-YSs1eRSfrU/photo.jpg', u'language': u'en', u'text': u'A breath of fresh air  and good food! Amazing cocktails, lovely service! Definitely one of my favorites in NYC! ', u'author_name': u'Justin Deakings', u'author_url': u'https://plus.google.com/114932177796916845629', u'time': 1465892379}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-xvZEAGLnx30/AAAAAAAAAAI/AAAAAAAAQ6Y/JFohxZhnc-Y/photo.jpg', u'language': u'en', u'text': u'Red Farm is absolutely amazing. High end, but the food is fantastic. The service could be better, but the food really makes the wait and price justified. ', u'author_name': u'Mattia Ruta', u'author_url': u'https://plus.google.com/110513094871369750742', u'time': 1459011318}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-2q2j3C4RCDU/AAAAAAAAAAI/AAAAAAAAGNc/cRGVg5KwU2E/photo.jpg', u'language': u'en', u'text': u'What I can say about this place is definitely without hesitation make reservations. On a Friday or Saturday night as early as 6 p.m. the wait can be as high as two hours. Also understand that going in here it's a farm table set up. If you are unsure what that means, it means that chances are you'll be sitting at a very large table with a bunch of other people that you don't know. And if you're on a date or out to dinner with your significant other the chances of you sitting in a small little table is not going to happen and they're going to be sitting across from you while you have people that you don't know sitting to the left and the right of you LOL. But with that said the atmosphere inside is really Boutique and fantastic and it's in a great neighborhood of New York City. The food is extremely fresh and completely different and just taste fantastic. The only reason I did not give it 5 Stars was because I was one of the people that failed to make reservations and I had to wait two hours and because of the farm type of seating arrangement that I'm not a big fan of. Otherwise you need to make sure that this is definitely on your top 10 restaurant list if you're in New York City.', u'author_name': u'Matt Williamson', u'author_url': u'https://plus.google.com/101873893384914983929', u'time': 1458014403}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-BYViH9PRr98/AAAAAAAAAAI/AAAAAAAAHao/yl1P36olTkA/photo.jpg', u'language': u'en', u'text': u'Food is four stars,  but deduct one star for ambience (way too crowded and cramped),  lack of reservations (usually an hour wait),  and price (would rather go to mission Chinese).   
I recommend the crispy beef appetizer and crispy skin smoked chicken.  Skip the Pac-Man dumplings. ', u'author_name': u'Senthil Sundaram', u'author_url': u'https://plus.google.com/104447484785052590878', u'time': 1457822774}], u'formatted_phone_number': u'(212) 792-9700', u'address_components': [{u'long_name': u'529', u'types': [u'street_number'], u'short_name': u'529'}, {u'long_name': u'Hudson Street', u'types': [u'route'], u'short_name': u'Hudson St'}, {u'long_name': u'Lower Manhattan', u'types': [u'neighborhood', u'political'], u'short_name': u'Lower Manhattan'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10014', u'types': [u'postal_code'], u'short_name': u'10014'}]}

