ddress': u'<span class="street-address">95 1st Avenue</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10003</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 917-408-3395', u'reviews': [{u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'language': u'en', u'text': u'Had a great lunch here with some of my co-workers. The happy hour here is great! Plus the service was really friendly and we got seated right away when we arrived. We ordered a few different types of oysters, they were all so good! If you've never had oysters I definitely recommend coming here to try it out, you won't regret it. This spot is perfect for first timers! I can't wait to come back for more. :)', u'author_name': u'joey santana', u'author_url': u'https://plus.google.com/110502872443880194605', u'time': 1464889953}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'language': u'en', u'text': u'This is my and my husband's favorite place in all of east village! Their craft beer selection, prices on oysters, and quality service is unbeatable for the village! It's perfect for any occasion, including the solo dining with a nice book .', u'author_name': u'Heather S', u'author_url': u'https://plus.google.com/118268664450213167432', u'time': 1467079079}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-WWeyHAfMa_E/AAAAAAAAAAI/AAAAAAAAAEw/cn3jjZFnhzA/photo.jpg', u'language': u'en', u'text': u'Good seafood restaurant, the staffs were helpful and attentive. Atmosphere was laid back and relaxing. The food was so yummy and delicious, had the clam fettuccine that was awesome cooked to perfection, seasoned well, fettuccine was al dente. Their homemade whiskey cake very good also. Overall great place and suggest people to try it. ', u'author_name': u'Rafael Yau', u'author_url': u'https://plus.google.com/107744062940210293013', u'time': 1466953197}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-0BHklQbg0Kg/AAAAAAAAAAI/AAAAAAAAABY/TtwP_ehjV1c/photo.jpg', u'language': u'en', u'text': u'Love Scallop Risotto! Fresh food, one of the best seafood place in the area. Reasonable price. This place is a perfect location to celebrate special events.', u'author_name': u'Faith Ross', u'author_url': u'https://plus.google.com/109994680240397102921', u'time': 1458705279}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'language': u'en', u'text': u'Several weeks ago, I learned that 88 Palace hired the dim sum chef from Golden Unicorn and I was somewhat eager to revisit this restaurant for the first time in many years. 88 Palace's popularity stems from their great deal of every dim sum for $1.50. This promotion to win over patrons has proven to be very successful, but one has to wonder how much longer the restaurant can survive on such small margins as a result of it. It is highly recommended that people arrive early, or your craving of cheong fun (rice noodle rolls) might go unsatisfied.

As a fan of the dim sum at The Golden Unicorn Restaurant at the E.Bway and Catherine Street, 88 Palace definitely showed tremendous improvement in the diversity and presentation of their offerings. All of the main dim sum items such as shumai, cheong fun, fung zao, and spare ribs were served hot and tasty. And the turnip cake actually has turnip in it ! I am glad to see that the investment into improving the quality of their dim sum has paid off. It has made 88 Palace a cheap and (dare I even say) solid choice for dim sum goers.

On a side note, as Jando had mentioned in his review, beware of the old man servicing the men's room!', u'author_name': u'seen jee', u'author_url': u'https://plus.google.com/107681614363383552114', u'time': 1459261917}], u'formatted_phone_number': u'(917) 408-3395', u'address_components': [{u'long_name': u'95', u'types': [u'street_number'], u'short_name': u'95'}, {u'long_name': u'1st Avenue', u'types': [u'route'], u'short_name': u'1st Avenue'}, {u'long_name': u'Lower Manhattan', u'types': [u'neighborhood', u'political'], u'short_name': u'Lower Manhattan'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10003', u'types': [u'postal_code'], u'short_name': u'10003'}]}

{u'rating': 4.1, u'reference': u'CmRZAAAAbcVCXPXPKrFCap3qMRolwToGw0yTqj5BctoHKfA3siNAWDZVttoFDyLTh9dy3ppa4ZY246CQP5qZdVuDi-IzqzfXs1zOEDNqziDqSION-bjNHg3EDmU2hIJRq3md4DFbEhBiAaHcvTXHGWEYR7-mmAOzGhT9RAGMWY2-K1j8VGBxNjDbMyrL4Q', u'price_level': 3, u'place_id': u'ChIJ8T1deaFZwokRTtKgQXspQdY', u'url': u'https://maps.google.com/?cid=15438666606961545806', u'formatted_address': u'43 E 20th St, New York, NY 10003, USA', u'id': u'4226fabe15eeda805fbcfb2c0fb8f27c8087a469', u'permanently_closed': True, u'vicinity': u'43 East 20th Street, New York', u'scope': u'GOOGLE', u'website': u'http://elannyc.com/', u'utc_offset': -240, u'photos': [{u'photo_reference': u'CoQBcwAAACDHWqohZEdHohKdJhvsjxYYKEm4LMrl81a1j7HTR2ef_ehhf4HKEDbpNddMwo8oQZHNoj2SnmHkqd-mhASvsKgd5BhovHn6soyivvWgdPG4dQd0lB6M_n48BobM1Xs3NB0GjxFFkszgG6q8nPrBRkVxZhU_u51pS2k77h5gT2Y8EhAV4TxXfzZvUSKhsWsDFQ46GhR3FyGtHYXUkPNYJlpHnRDGu_vN6A', u'width': 1024, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/107131049614984369508/photos">\xe9lan</a>'], u'height': 683}, {u'photo_reference': u'CoQBcwAAALZ8yWET7qovb6U5-wFVwVHEk0XBa8I1NgXQMUYAmlNy7u5JjB-1VvXoZc4LAt6J44L1Yu1H4wH_MY5_N0yrlXZmJPIQSlQhGcHpiZLdCfyZf4WVOrlkpBgdLDAdPodmKXjoDjeustvVKJu_p5pxgJoftnxPiBp4v6D3-m2xB7f6EhBfTq_J109GIFWvXxh7H4TfGhQRCn7IEJXfg-ZjCw7G4LO3GPK-Gg', u'width': 900, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/107131049614984369508/photos">\xe9lan</a>'], u'height': 900}, {u'photo_reference': u'CoQBcwAAALkyGfclaeHYd0-AVTJr7g06EfzhqfMPj1YoaRRcDgfFce8ETQQMbp34K2YpycUbyWrBR-e7pUSEWMuwGRp1aCxf6EeC7eFz35i3yvRZxRydpKBuJJM6_jtH8c6qg9A5TWfnwCxoj-uw26_Vtu_N-BTXn4i5FtUkd64oFKHxBeatEhDuwn-zL4jjx0eCfqUj1vuAGhQG3ywx5PqGWUbFjeu4i6zcvsrkBA', u'width': 3072, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/105268063876154124556/photos">B. Walker</a>'], u'height': 3072}], u'types': [u'bar', u'restaurant', u'food', u'point_of_interest', u'establishment'], u'icon': u'https://maps.gstatic.com/mapfiles/place_api/icons/restaurant-71.png', u'name': u'élan', u'geometry': {u'location': {u'lat': 40.7388132, u'lng': -73.9884539}, u'viewport': {u'northeast': {u'lat': 40.7388901, u'lng': -73.98839145}, u'southwest': {u'lat': 40.73858249999999, u'lng': -73.98864124999999}}}, u'adr_address': u'<span class="street-address">43 E 20th St</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10003</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 646-682-7105', u'reviews': [{u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-Wsyy1Oj8hLc/AAAAAAAAAAI/AAAAAAAAAuk/Zo1dQ0ZK3kU/photo.jpg', u'language': u'en', u'text': u'Chef Waltuck is one of the greats, and I was a big fan of his previous restaurant, Chanterelle. (He has a knack for good restaurant  names, doesn't he? Loved the first one, and élan makes one want to leap forward in anticipation.) It is nice to see him experimenting more, here, but I also find the caliber of cooking to be less assuredly impressive. Don't get me wrong, there are many very tasty bites to be had, but also some dishes that simply aren't particularly impressive or hit the sweet notes too aggressively, for example. 

The staff is efficient, but can put on airs, and the decor (though nicely designed) is conducive to a somewhat cold experience. 

A quick note on my rating scale: 5 stars = exceptional food & service; 4 stars = excellent food & service; 3 stars = decent to good (top-of-the-line for fast service restaurants); 2 stars = mediocre; 1 star = not recommended. ', u'author_name': u'B. Y.', u'author_url': u'https://plus.google.com/114315063586251012230', u'time': 1450485792}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'language': u'en', u'text': u'When heading to a restaurant for the first time, I secretly say to myself, “Please, please, please make this one be really good.” Oh My!  I was blown away with Elan.  The food was scary good.  Chef David Waltuck delivered up a superb culinary evening.   Front of the house co-owner George Stinson treated us to how understated elegant dining is done and the service is stealth and efficient. When you see the reasonable prices, this will be one of your new favorite place in NY!!  ', u'author_name': u'Jane Lemmon', u'author_url': u'https://plus.google.com/110468788851189129921', u'time': 1445096703}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-YLoes8rqJD8/AAAAAAAAAAI/AAAAAAAAP7M/tXB4713ZyfM/photo.jpg', u'language': u'en', u'text': u'Culinary brilliance and consistency. This is our favorite neighborhood spot. From a quick elegant meal at the bar to date night or entertaining clients in the dining room, they never dissapoint. ', u'author_name': u'Lauren Leonard', u'author_url': u'https://plus.google.com/105440284186436463108', u'time': 1439347324}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-UYZ5LTFFqYo/AAAAAAAAAAI/AAAAAAAAC4c/ywVIRfk421U/photo.jpg', u'language': u'en', u'text': u'solid weekend brunch. had the mushroom croquette (delicious), the brioche toast (strangely funky taste), and the scrambled eggs with caviar (good but basic). downside was the room, which was blase like an airport lounge with no natural light. again the food was solid but nothing really special that would have me racing back.', u'author_name': u'David Bledin', u'author_url': u'https://plus.google.com/114920352077361310836', u'time': 1420947487}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-CNVRi08ZUSo/AAAAAAAAAAI/AAAAAAAABcw/7W6PmiGd6yk/photo.jpg', u'language': u'en', u'text': u'Very impressed in a genuine way. The service is impeccable and the dishes are unique. Most memorable was the warm creamed oysters with caviar. Highly recommend b', u'author_name': u'Sean Moorman', u'author_url': u'https://plus.google.com/116551859931241354470', u'time': 1420074794}], u'formatted_phone_number': u'(646) 682-7105', u'address_components': [{u'long_name': u'43', u'types': [u'street_number'], u'short_name': u'43'}, {u'long_name': u'East 20th Street', u'types': [u'route'], u'short_name': u'E 20th St'}, {u'long_name': u'Flatiron District', u'types': [u'neighborhood', u'political'], u'short_name': u'Flatiron District'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10003', u'types': [u'postal_code'], u'short_name': u'10003'}]}

