s="postal-code">10012</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-925-1613', u'reviews': [{u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'language': u'en', u'text': u'Went here after wandering around union square for a while looking for a sushi place on valentines. 

We didn't have a reservation which you could tell was unusual because the hostess looked at us like we were crazy but said she would see what they could do. Within 2 minutes we were seated at a table by the waiters station. We asked them if there were any other tables away from the craziness and she set off to work. Within another 2 minutes the hostess told us they had one more table, otherwise the wait would be 1.5 hours. The table was perfect! Upstairs with all the mood lighting and a table right in the middle. They were so accommodating. Plus the sushi was delicious. Nice big rolls which were tightly rolled ( I hate when they start falling apart). The fish was super fresh too. We did think however that some of the rolls could have used a little more flavor though ( mango tuna had no hints of mango and the $12 king crab roll was just that with avocado). 

But, like I said, the meal was great, the service was wonderful and we will definitely go back.', u'author_name': u'Lynn Lan', u'author_url': u'https://plus.google.com/112325306401090496442', u'time': 1461789090}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-ygl0lbGb6uE/AAAAAAAAAAI/AAAAAAAAAGA/okssF8vPBAI/photo.jpg', u'language': u'en', u'text': u'Loved the decor, amazing service and super delicious Omakase. They don't miss a beat, highly recommended.', u'author_name': u'Samuel Park', u'author_url': u'https://plus.google.com/107028064251757795562', u'time': 1455376922}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'language': u'en', u'text': u'The omakase was fairly good. My favorite course was the scallop tempura with truffle and tofu. ', u'author_name': u'B Bo', u'author_url': u'https://plus.google.com/101368973120650756233', u'time': 1452411944}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-iEaOuWkq5GE/AAAAAAAAAAI/AAAAAAAABBU/6jL2kBqFR80/photo.jpg', u'language': u'en', u'text': u'The unique kappo style Japanese dishes use freshest picked seasonal ingredients and are handled with great care and patience to achieve the taste and elegance. Make sure you talk with the chef about your preference and enjoy the richness of flavor in the simplicity.', u'author_name': u'唯色嘉措', u'author_url': u'https://plus.google.com/112706147596484058783', u'time': 1433215071}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-O3LBS3aviIo/AAAAAAAAAAI/AAAAAAAAXuc/0Vz-TGDbsQc/photo.jpg', u'language': u'en', u'text': u'One of the best meals I've ever had. The smaller Omakase was the perfect size for the lighter eater.', u'author_name': u'Daniel Yehuda', u'author_url': u'https://plus.google.com/117432404414314571603', u'time': 1410216025}], u'formatted_phon