}, {u'photo_reference': u'CoQBdwAAANQKPszqeaEIuGUgFtZzGg1HO1GI5LM12RmtRMhpoWhw-xyB19EuhUe39_L_RMY92s_iz_a5yq5nVARKyethD6_6QLzby4zEtD6xON_TIsbQ8FhKvcRNUdP2jSCXj0YQeixMAEnPxmkeyDURlyVnMoO1vrOhrN7z4krZyLeYqOCPEhBF3aWiovaoUbBP5nSvrIX2GhTBzEF5BKxUdsYQ0qE_ZHE6Vmufyg', u'width': 4411, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/115243429637828320065/photos">Stewie Vill</a>'], u'height': 2760}, {u'photo_reference': u'CoQBcwAAAPUSP1LjnM6mhSAhaub2muvqt73ZAcMuqa1hnzPlBAg4TySc9SUfK8xZswDYKXNyuoVHTqfJSFnJwEehMO-ZdbRyppWP6TCEyuCkwux4XJMyvz99CYj7ol4CO6tT7lQH0m3tbbxPo-QDLwvcECYF6V9gk-JU9X4TEH45XZXJ5qh_EhDh4tTUJWj9QRdLuANu-YwqGhQ_g4-lLnaE7HGWiTfDxcxNp7dBuQ', u'width': 816, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/105400766621474864875/photos">Tiffany Cheng</a>'], u'height': 612}, {u'photo_reference': u'CoQBcwAAAHRaPSFuiJp_S9L0hgUT95UcqIIqoj6fqOmYCjuEmU7QNFrSh8-DBwaNNWSvem5Vmgjcsio7_mZ9pSIm1aBO0jumcE7SeVnqLNAF8nuPTyhK22yKfSu_4cHx20mOJG4x_mC9aZGN6mKnOGp-Xcs-f7oXjjRQFspbJr6JOkkihhevEhC4bMvnJnJ15ZyGEVlBA3kdGhQXbwwIZ8X9xKopTsjxvxw8vulTsw', u'width': 1365, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/104111246635874032234/photos">ZAGAT</a>'], u'height': 2048}, {u'photo_reference': u'CoQBcwAAAEVD1_byyDMsJs0NnQz87brOvpMQctt8Nnf8drecV1NN-_SoJ5K79aTleHvGTJ6aHnM1MjmocK6yRVN1VaKJkxZ3uqgwMJKQKdjr_kQ3DOzeb-RZu2gJbQUVBwf9uWDfDa_-lCTab255UUh4GNb6-ibLHiTDDvLb-yqniQvf9NYhEhBxFVgreLF6GsHuvFwoACdkGhQuZUS_ZkaZxZB3GwpodT-VqOpFUg', u'width': 2048, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/101457039455828279572/photos">Maryann Yin</a>'], u'height': 1536}], u'types': [u'bakery', u'meal_takeaway', u'cafe', u'restaurant', u'store', u'food', u'point_of_interest', u'establishment'], u'icon': u'https://maps.gstatic.com/mapfiles/place_api/icons/restaurant-71.png', u'name': u'Breads Bakery', u'geometry': {u'location': {u'lat': 40.736609, u'lng': -73.9917735}, u'viewport': {u'northeast': {u'lat': 40.73700214999999, u'lng': -73.9915281}, u'southwest': {u'lat': 40.73647795000001, u'lng': -73.9918553}}}, u'adr_address': u'<span class="street-address">18 E 16th St</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10003</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-633-2253', u'reviews': [{u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-qzWzBvLyVNY/AAAAAAAAAAI/AAAAAAAAAU8/bFdT4LJ5Hfg/photo.jpg', u'language': u'en', u'text': u' It is always busy and has a good reputation. I'm a BOB (baller on a budget) So i couldn't splurge. Despite this I still ended up spending about $15 bucks  in here. I had the vegan sandwich about $10. It's filled with cauliflower, greens and a tasty spread. I recommend it, it was surprisingly yummy. Everything here tastes very fresh and although I only tried 2 items, I believe is worth returning as everyone seems to rave about their pastries and other goodies. 1 star off because it is expensive but I can't stop eating so I shall be back and end up poorer. ', u'author_name': u'Stewie Vill', u'author_url': u'https://plus.google.com/115243429637828320065', u'time': 1464910053}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-DyvGLXDImu8/AAAAAAAAAAI/AAAAAAAAR7Y/eX2bDHJxtOo/photo.jpg', u'language': u'en', u'text': u'Being a huge Seinfeld fan, I came to New York with the intention of finding a chocolate (or cinnamon) babka (they don't make then out West). I did a lot of research before coming and found that Breads Bakery heralded the best babka. We made a special trip just to try it and oh my goodness. It is melt in your mouth delicious. So delicious that the next time my husband went to NYC for business I made him go out of his way to buy several the day before he left so they would be fresh the next day on his return. I crave these, they are that good. ', u'author_name': u'Jillian Fritz Christensen', u'author_url': u'https://plus.google.com/107914201745831688348', u'time': 1464190800}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-coPYsfefAuM/AAAAAAAAAAI/AAAAAAAACNg/R6_eAIiPGz8/photo.jpg', u'language': u'en', u'text': u'rugella and almond danish were very good. staff were friendly and helpful. Definitely live up to the expectation I had. was planning on trying chocolate babka, but it's pretty big, wish you could sell by slice. but i would definitely come back to try out other stuff.', u'author_name': u'Chen Sh.', u'author_url': u'https://plus.google.com/100043055170477515579', u'time': 1462554208}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'language': u'en', u'text': u'Chocolate babka is amazing!! I always stop every week on my way through if I get out of class in time before they close and get a loaf to share with my roommates and it's always gone within 20 minutes of walking through the apartment door!! Have not tried anything else since I'm a creature of habit but everything always looks amazing. Bought a poppyseed cake for my father once and he said it was the best thing he's ever had. Although I have a love/hate thing with the food being out for people to just take. I like it cause it makes it easy for me to just walk in and grab one that looks good but I also don't know how many other people or kids have had their hands over the food. Other than that I love this place. Staff is always supper friendly and polite which is a rarity in New York bakeries. Never super busy when I go there so you don't have to wait in line for long. Tables in the back for you to sit if you wanted too. Just an overall great place. ', u'author_name': u'Emily Timmons', u'author_url': u'https://plus.google.com/113836311896440271528', u'time': 1463195464}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-LQh3AYwshu4/AAAAAAAAAAI/AAAAAAAAAEY/0ym3dXXshSk/photo.jpg', u'language': u'en', u'text': u'Delicious, but too expensive for my tastes.  I love the ambiance, location, and how everything is unique and you can tell they care about the baked goods, I just lean on the gooeyer side of baking and things here are firmer/crispier (like the babka...love babka and eat a lot in NYC and South Florida...I like the ones that are more challah like with ribbons of goodness like from trader joes).

That being said, I stop by for a treat when I'm in the area.

