5, u'lng': -74.00494585}, u'southwest': {u'lat': 40.70813485000001, u'lng': -74.00508045000001}}}, u'adr_address': u'<span class="street-address">32 Cliff St</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10038-2853</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 646-546-5426', u'reviews': [{u'rating': 2, u'aspects': [{u'rating': 0, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-JUPm-qZcK0E/AAAAAAAAAAI/AAAAAAAAANU/sLZMR9ViFAY/photo.jpg', u'language': u'en', u'text': u'Didn't even set foot into the place.   It looked amazing from the outside but the bouncer was very rude and arrogant; not even standing near the doorway but sitting on the steps of an adjacent building but is surprised that no one hears her asking for ID or believing that she is part of the establishment.   With the way she was treating potential customers ("are you f*cking deaf, ID's from all of you" barely audible) my party of six just moved down the block and found two places a few doors down. 

Would like to come back a different day and give it another shot; hopefully the bouncer that night will know how to treat people better!', u'author_name': u'Dexter Raphael', u'author_url': u'https://plus.google.com/105375867364033031402', u'time': 1464497036}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-krCIBJeQG3U/AAAAAAAAAAI/AAAAAAAAkcE/9V5h8KZdOyk/photo.jpg', u'language': u'en', u'text': u'I'm sure this place is polarizing. The booze is cheapish, the food is terrible. But the bartendresses seem to schedule dancing on the bar and there's a swing for special dances which are surprisingly acrobatic. It's an experience to try with people who'd want to ogle at ladies and pregame. Can of beer + shot was $7 when I went, but if you order a (larger) shot on it's own it was $8 on a Saturday night.', u'author_name': u'Diana Liao', u'author_url': u'https://plus.google.com/115610459958454571580', u'time': 1463113898}, {u'rating': 2, u'aspects': [{u'rating': 0, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-aTd6qQPE23w/AAAAAAAAAAI/AAAAAAAAAP4/aH1Pr0h03VU/photo.jpg', u'language': u'en', u'text': u'Cheap drinks and a great burger and drink deal.  There's a swing on the bar for the bartenders, so be sure to buy your bachelor friend's a ride and drink.

Unfortunately it's a dirty and dark place and the bartenders aren't very friendly at all once there's more than 5 people in the place.', u'author_name': u'Andrew Shen', u'author_url': u'https://plus.google.com/108462981404926274562', u'time': 1463884168}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-tXqcJbtUwA4/AAAAAAAAAAI/AAAAAAAAfzc/mce4kYmbu2g/photo.jpg', u'language': u'en', u'text': u'Best local joint I have found yet downtown. Had beer and nachos at 630pm on a Monday. Music was great, not crowded and cheap. Exactly what I was looking for.', u'author_name': u'Jeffrey Liss', u'author_url': u'https://plus.google.com/101770766535299414481', u'time': 1463439300}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-ybGX2ocNeQ4/AAAAAAAAAAI/AAAAAAAAo7I/2mVHS4Qa9DI/photo.jpg', u'language': u'en', u'text': u'$5 PBR with a whiskey shot plus a bar swing... that should give you an idea of what you are walking into.  Its a great place to start the night or end it.  Super cheap drinks and a wild bar scene.  Best time to go are weekends,  usually tame during the week.   ', u'author_name': u'nirmal patel', u'author_url': u'https://plus.google.com/111971303686191945599', u'time': 1447688910}], u'formatted_phone_number': u'(646) 546-5426', u'address_components': [{u'long_name': u'32', u'types': [u'street_number'], u'short_name': u'32'}, {u'long_name': u'Cliff Street', u'types': [u'route'], u'short_name': u'Cliff St'}, {u'long_name': u'Lower Manhattan', u'types': [u'neighborhood', u'political'], u'short_name': u'Lower Manhattan'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u's