 -74.00317255000002}}}, u'adr_address': u'<span class="street-address">239 West 4th Street</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10014</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 646-449-9336', u'reviews': [{u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'language': u'en', u'text': u'The staff and atmosphere is great! The food was amazing! My husband claims it is one of the best old fashioned's he has had! ', u'author_name': u'Danielle Klyczek', u'author_url': u'https://plus.google.com/105928655458224168810', u'time': 1456625401}, {u'rating': 1, u'aspects': [{u'rating': 0, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-jtpyNlWQurY/AAAAAAAAAAI/AAAAAAAAIGU/Rwp-FQgB6MQ/photo.jpg', u'language': u'en', u'text': u'Drinks are good, food is ok, service is terrible.

The place was empty and still they wouldn't sit us - two people that came for drinks and a snack - because we said that someone might join us. I wouldn't mind waiting except they asked us to stand uncomfortably by the bathroom while we were having drinks.', u'author_name': u'Miki Noam', u'author_url': u'https://plus.google.com/107184868284467046832', u'time': 1457462436}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-K-ETDmjkeT8/AAAAAAAAAAI/AAAAAAAAAHQ/M6NS6kIceEo/photo.jpg', u'language': u'en', u'text': u'Amazing fresh food with great wine pairings. Great place for a date. ', u'author_name': u'Darrell Capeding', u'author_url': u'https://plus.google.com/100245510113366750545', u'time': 1457058750}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'language': u'en', u'text': u'Yes.  I gotta say that the relaunch of Bar Fedora is a success.  Love the low key atmosphere.  Love the old feel of the West Village Speakeasy.  Very good food and very good service.  Questionable pricing, however.  Last visit (with a first date), we had two vodka martinis each, and two appetizers that we were very kindly told up front (without asking) were $13.50 each.  Not bad.  Until we got the bill for $100 - which means the martinis were about 18.75 each (including the tax of course).  A bit pricey for the venue I think.  ', u'author_name': u'chris snyder', u'author_url': u'https://plus.google.com/115224634582492857794', u'time': 1434217766}, {u'rating': 1, u'aspects': [{u'rating': 0, u'type': u'overall'}], u'language': u'en', u'text': u'Went in last night with some good friends on a recommendation and the male bartender said they were doing last call, so we ordered quickly as well as drank quickly. The female bartender was sweet, but the guy was extremely upset that we were there and made sure we felt it. As people who all work in restaurants, we know how annoying it is when someone comes in before closing, but we also know how to take care of our own when tipping. I asked the nice bartender if they pool tips and she said yes. I told her that it was a shame because I would have tipped more if I knew he wouldn't be getting a part of it. 20% was what I left, but as the customers who came in close to closing it could neve easily been 50%. I guess the pouty bartender doesn't like making money. That's fine because I don't like tipping bad service with my own hard earned tips. 
I highly recommend that you go elsewhere for drinks in NYC such as the Stonewall Inn. Great people, non-bitchy service and much cheaper drinks. ', u'author_name': u'Kimberly Stout', u'author_url': u'https://plus.google.com/109015964774399834977', u'time': 1424974446}], u'formatted_phone_number': u'(646) 449-9336', u'address_components': [{u'long_name': u'239', u'types': [u'street_number'], u'short_name': u'239'}, {u'long_name': u'West 4th Street', u'types': [u'route'], u'short_name': u'West 4th Street'}, {u'long_name': u'Lower Manhattan', u'types': [u'neighborhood', u'political'], u'short_name': u'Lower Manhattan'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10014', u'types': [u'postal_code'], u'short_name': u'10014'}]}

