t', u'food', u'point_of_interest', u'establishment'], u'icon': u'https://maps.gstatic.com/mapfiles/place_api/icons/restaurant-71.png', u'name': u'L'Apicio', u'geometry': {u'location': {u'lat': 40.724452, u'lng': -73.9915614}, u'viewport': {u'northeast': {u'lat': 40.7246341, u'lng': -73.9914318}, u'southwest': {u'lat': 40.7243913, u'lng': -73.9916046}}}, u'adr_address': u'<span class="street-address">13 East 1st Street</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10003</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-533-7400', u'reviews': [{u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'language': u'en', u'text': u'Was hesitant to go here since I had a really bad experience at sister restaurant dell'anima. However this restaurant was pretty good. We had the gem salad which was delicious and tangy with the feta and lemon. We also had the special pasta with wild boar cooked in wine and chocolate sauce which was delicious. My husband had the shrimp spaghetti which was cooked to perfection texture and the shrimp was a lovely texture and taste as well. For dessert we had the chocolate truffle cake which was more fudgy and less cake like but still pretty good. The waiter suggested a complimentary wine with my wild boar pasta which was a delicious Italian wine and was not the most expensive one on the menu. Waiter was very nice and hostess seated us at a different table that we preferred. This restaurant was overall good and I would go back again but I wouldn't say it was outstanding or worth 5 stars, but still definitely tasty. The place has a very trendy and hip vibe and is also very spacious and a large restaurant which is rare in Manhattan.', u'author_name': u'Theresa Marko', u'author_url': u'https://plus.google.com/110431435907996139256', u'time': 1456595616}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-RVO3fQ3KHxg/AAAAAAAAAAI/AAAAAAAADV0/AGSemuWlZp8/photo.jpg', u'language': u'en', u'text': u'L'Apicio is awesome! The interior is very trendy, young and hip. The food is really great as well. The pasta Tajarin and the Tuscan fries were freshly made, the cocktails were just okay, and the waiter really knew how to form lasting relationships with patrons. Bring a date or go for a special occasion.', u'author_name': u'Tiffany Cheng', u'author_url': u'https://plus.google.com/105400766621474864875', u'time': 1429304700}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-ei2TScoAMNY/AAAAAAAAAAI/AAAAAAAA2_8/qpMUUdS7ihw/photo.jpg', u'language': u'en', u'text': u'Great modern italian. Pasta is cooked to perfection and some unusual flavor combinations take it to another level. Service can be a bit judgmental but one might just get over it since the food is so good.', u'author_name': u'Rejane S', u'author_url': u'https://plus.google.com/103651153706195020571', u'time': 1415707794}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-7o1aMRZAA40/AAAAAAAAAAI/AAAAAAAAAEw/TXPgRNMCfv4/photo.jpg', u'language': u'en', u'text': u'A fantastic array of appetizers and contorni make for fun sharing ahead of delicious and balanced pastas. Definitely go for the Polentas, particularly the short ribs and pork meatballs- just incredible! However, the food can be over-seasoned with salt. Go for your heavier, rustic Italian dishes - especially in a place named for Italy's most famous recipe creator!
', u'author_name': u'Clayton McGratty', u'author_url': u'https://plus.google.com/107377015313372986899', u'time': 1412370217}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-CGVDyhCEAFM/AAAAAAAAAAI/AAAAAAAABnA/z3aHVVUiO8Y/photo.jpg', u'language': u'en', u'text': u'L'Apicio has very tasty food and the portions are a great size.  For appetizers, we had gotten a cheese appetizer and dinner we got the chicken and pork chops.  We also go the hazelnut ice cream/cake for dessert which was delicious.  I loved all of the food at the restaurant.  I just wished there was more of a selection on the menu.

The atmosphere was also very intimate and romantic, great for dates or dinner with friends.', u'author_name': u'Elizabeth Tam', u'author_url': u'https://plus.google.com/109213508069395321210', u'time': 1384749597}], u'formatted_phone_number': u'(212) 533-7400', u'address_components': [{u'long_name': u'13', u'types': [u'street_number'], u'short_name': u'13'}, {u'long_name': u'East 1st Street', u'types': [u'route'], u'short_name': u'East 1st Street'}, {u'long_name': u'East Village', u'types': [u'neighborhood', u'political'], u'short_name': u'East Village'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10003', u'types': [u'postal_code'], u'short_name': u'10003'}]}

