uPATDnmdsX1JGLdCLl4gwAxCXlZpFGXzutxbZlEhBW4TfYrCL2CqLSqXidpV6jGhSWl8vCiyjhQ3ZVY5BoSGUTGxWvVw', u'width': 4928, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/114104688860131560796/photos">B\xe2tard</a>'], u'height': 3280}, {u'photo_reference': u'CoQBcwAAAAmSOM_qMs955HpT0_cbhPvbD_E4RcHw_BQ-k1UoC5mWmaHY9jlnXmmLD2KNCzW9CkpNGafA9O-mFe7RFwOJ5zWEpzNSgSo-ez4q6eqDn1AyjHBBoH5S3tMkp-N4I2PS1qFmjdEcRKF7lqoHq72AHku9SC49_BV-L8lFqprKJPElEhCo2DF4-_GbMnu-ey1KWDE4GhSVPvAaiyolgOE4_LiDwccEOCL-Cw', u'width': 680, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/104111246635874032234/photos">ZAGAT</a>'], u'height': 340}, {u'photo_reference': u'CoQBdwAAAH2InCwLsW7DQvFU10G7okkimMkckGnaLHDtllWa7gzXqvxZJCPexx3y9SqyCrgjbyR7_veyopp1hY7kabdO0ozUO5QDHcO9lcB5j0fhJdVBsGn-qIdAjRsZJBsq1fgLM_sJGN4AtFlA4z2OP-0bl7Use9Yvrds8v3TQskI37zZUEhD-VBhfZUh9apCJDfUgkZ4KGhRhcG2S8E5UYBah2rah9eytBRyhFQ', u'width': 1000, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/114104688860131560796/photos">B\xe2tard</a>'], u'height': 1000}, {u'photo_reference': u'CoQBdwAAANwOh3WjCmscmHACi6Yk2ZPAYzHbdheDzcdyNurfs_Tv4AasoE9jGhZxKZTaChsg0vrqg_IzmRk9AiOnAe6GM3uzzLEXhrOazudQO-HJh04AU9e9CUOassq5Wu0ViI3vSq0tAteZW5Ba07uM590KqNMws5rllTC5VhnnOSuZC3-AEhDWuX7PNa9xHDHvCN0IP0ZaGhQiLF1ZYL1pLBKSkRW68GK7sSLDfw', u'width': 4928, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/114104688860131560796/photos">B\xe2tard</a>'], u'height': 3280}], u'types': [u'restaurant', u'food', u'point_of_interest', u'establishment'], u'icon': u'https://maps.gstatic.com/mapfiles/place_api/icons/restaurant-71.png', u'name': u'Bâtard', u'geometry': {u'location': {u'lat': 40.7195598, u'lng': -74.0057489}, u'viewport': {u'northeast': {u'lat': 40.71965189999999, u'lng': -74.00561119999999}, u'southwest': {u'lat': 40.7195291, u'lng': -74.00616199999999}}}, u'adr_address': u'<span class="street-address">239 W Broadway</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10013</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-219-2777', u'reviews': [{u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-WWeyHAfMa_E/AAAAAAAAAAI/AAAAAAAAAEw/cn3jjZFnhzA/photo.jpg', u'language': u'en', u'text': u'I had the pleasure of dining in batard great experience due to the service I received and the food was amazing. The staffs are nice and helpful with all the question I asked. I recommend trying the pea soup and the rabbit  in flavors of bouillabaisse. Overall this is an awesome restaurant and definitely in my top 10 restaurants to try. ', u'author_name': u'Rafael Yau', u'author_url': u'https://plus.google.com/107744062940210293013', u'time': 1465276481}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-cJYDdwPLJMY/AAAAAAAAAAI/AAAAAAAAB9o/g29ZGODo3S4/photo.jpg', u'language': u'en', u'text': u'For a special occasion, it was perfect.

The food was fantastic and, while it's definitely not "cheap" (by any stretch of the imagination), it's also not overpriced for the overall experience. In all honesty, for the food quality, location, and the fact that it now carries a Michelin Star, I'd actually say this is reasonably priced. We've eaten in lesser restaurants and paid more.

The thing that stood out the most for our dinner experience at Bâtard was the attention to detail. From the techniques used in the food and the plating, to the service and little touches from the staff that make all the difference. We were treated wonderfully and left extremely satisfied.', u'author_name': u'Paul Armstrong', u'author_url': u'https://plus.google.com/109138554820310941394', u'time': 1461595924}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-ZWpgfeovjvA/AAAAAAAAAAI/AAAAAAAAyu4/HRvalVL9ZWA/photo.jpg', u'language': u'en', u'text': u'I know what you're thinking. Only 3 stars?  What's this guys problem? He must be a real jerk to give a fancy place only 3 stinky stars. Well, I'll tell you something Jerry, this place was over priced.  So just be aware of that trend. Food was nice,I suppose, but as I said before, overpriced. Sorry Batard. Also, get rid of that little squiggly line above the a in your namesake. No one is impressed except for Jerry.', u'author_name': u'Adam Wozney', u'author_url': u'https://plus.google.com/112491783947200415559', u'time': 1461353573}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-epJOwpC2UzM/AAAAAAAAAAI/AAAAAAAAAgI/vYxnd-FlsmM/photo.jpg', u'language': u'en', u'text': u'This was my fourth time dining at Batard, and sadly, with each return visit, my experience has significantly diminished in terms of the food only (the service has always been excellent).  I chose the three-course dinner option and began my meal with a steak tartare, which was, in fact, quite delicious - but sadly, it was also the only course that I would be able to say that about.  It was rich and meaty with the perfect texture and flavor that did not require any of the accompanying toast as it was perfection on it's own.  I wish my meal had stopped there - but it didn't.  I then moved on to the Saffron Linguine whose description included razor clams, uni, lobster bottarga  and white wine.  I love uni.  It is one of my favorite things to eat and it was my deciding factor in ordering this dish.  Sadly, there was none to be found on my plate.  Zero.  Not a hint or trace of it anywhere.  Other members of my party that ordered the same dish reported that they either had none as well, or miniscule pieces that were barely noticeable.  The pasta itself was overcooked and flavorless.  Razor clams were as expected, but chopped into tiny pieces and did not do much to help the dish in terms of flavor.  The white wine sauce with lobster roe that was at the bottom of my dish (not covering the pasta, which sat on top of it flavorlessly) was good, but also not enough to make this dish anything special or worth ordering.  I was hoping my last dish, Beef Short Ribs with black pepper streusel, grilled wagyu beef tongue and polenta, would be as good as the tartare - but it wasn't. The beef was incredibly dry, the polenta overly salty to the point where it was inedible, the streusel was literally a small pile of crumbs on the plate and the accompanying spinach (not mentioned in the description) would have been fine had it also not been plagued by an enormous amount of salt.  The only saving grace of this dish was the wagyu beef tongue, which was fantastic, but just one small slice of it was not enough to make this a positive experience.  The three stars I give Batard are more for their excellent service and past positive experiences, but considering the gradual decline in the quality of the dishes since it first opened makes me reluctant to try again.', u'author_name': u'Ellie Rauch', u'author_url': u'https://plus.google.com/105896913686491707351', u'time': 1460473156}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-2kROZSEJhs0/AAAAAAAAAAI/AAAAAAAAAAo/rKavTPhgX-4/photo.jpg', u'language': u'en', u'text': u'We went there for a special occasion. The food was amazing, but the place was so noisy and the service so poor that we had to skip the dessert and move to another place.', u'author_name': u'ordinary routine', u'author_url': u'https://plus.google.com/110260100966652932599', u'time': 1463922288}], u'formatted_phone_number': u'(212) 219-2777', u'address_components': [{u'long_name': u'239', u'types': [u'street_number'], u'short_name': u'239'}, {u'long_name': u'West Broadway', u'types': [u'route'], u'short_name': u'W Broadway'}, {u'long_name': u'Tribeca', u'types': [u'neighborhood', u'political'], u'short_name': u'Tribeca'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10013', u'types': [u'postal_code'], u'short_name': u'10013'}]}

