oQBcwAAAK3qNJ2m9iG9B8DkSXROOdnCra_6JQ_kBOt0U-GEjw9cVR7D0zjeGdHRPW_wonbHoLsFZ02raxhTWgaZfXv5K7DYg59BlmqcnjCX5quqPVBWYeZTJkiGUy-Gb_O5e_jr1lVLoRTzJrcbvuHdQZoJFZnmYKlmV9r9hxUP_hAK6JxhEhBQRzFcta69KQO9VVY6N-FPGhTfSTjksq6aSmVzNJdLONrlWgFlxg', u'width': 472, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/100133647553911252571/photos">La Contenta</a>'], u'height': 471}, {u'photo_reference': u'CoQBcwAAAA29MCkYoYim3ZSZIUbDo1D0F1obAXzLqFU-5mhYljpM4HSL0wCLVQ7ae-hnmMYWNKGQ55r0Ja6gfUBkQBoYsI1wgCgEI2w8SR04tSLcDaYa5i4dxuyqY5Mcr7JfaeACloPi-bYogk7Gs7HoxjCkn58aIYVIY6dLWs-z2CTPt8YWEhBbDHLRLc5m3MOisGtCn3_0GhQQLJJRU7kIlfvEAU3j9aE8XvRe2Q', u'width': 2048, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/100133647553911252571/photos">La Contenta</a>'], u'height': 1365}, {u'photo_reference': u'CoQBcwAAAEG3wBeaSMZ5PxsXj-qoWlIdohc_EbFfW_TaHAZk49vBqVm2d_RrUOMVT6mUVJBMrjNFcPsz7EuLXOHZDa8gZmvbvJ1S2HD33w57bOdXOTd8BpDLOK7MlTMtyTMlq7CsdTIZU88ftCzjqG44PPUZ8-rWIMbqDKrejrYDzraFSPoYEhCLhIvFlyf8bsPmre6tVfPYGhRvl0PmciH8DaFpXyf34Mf_dRnksA', u'width': 2988, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/105400766621474864875/photos">Tiffany Cheng</a>'], u'height': 5312}, {u'photo_reference': u'CoQBcwAAAACVi4ccALKZ_y4Y48bfJBCRK5daDL_CgsHOKMUFsKStcfaH8w1ufWyjEEpx4yl-BwxmuUN3d9jrGD7psVP7G6Ht3YRv_EGxYFF4_zOgfdw5vEtC96XubRIc-GY2P5PsANmziYlZDzBnpwfmgenQRzGpSRYWt8ZuDBnDPcoA9T_FEhB57fwjaJo8LpVhJHhFQobrGhR45ezFzZkWWftwXYpebN5Z0Hg1UA', u'width': 1365, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/100133647553911252571/photos">La Contenta</a>'], u'height': 2048}], u'types': [u'restaurant', u'food', u'point_of_interest', u'establishment'], u'icon': u'https://maps.gstatic.com/mapfiles/place_api/icons/restaurant-71.png', u'name': u'La Contenta', u'geometry': {u'location': {u'lat': 40.7187334, u'lng': -73.9869392}, u'viewport': {u'northeast': {u'lat': 40.718833, u'lng': -73.98682335}, u'southwest': {u'lat': 40.7187002, u'lng': -73.98728675000001}}}, u'adr_address': u'<span class="street-address">102 Norfolk St</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10002</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-432-4180', u'reviews': [{u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'language': u'en', u'text': u'Super cool Mexican spot! It's very busy and packed all the time so I finally checked it out with some of my friends and we had a great time. We got there on a Thursday evening without any reservations and only took about 5 mins to get seated. As soon as we sat down they brought out waters, chips & salsa and took our beer order. We ordered a few appetizers and our main dished at the same time. Our appetizers came out really quickly and everything was so freshly made I couldn't stop eating the appetizers but I knew I had to save some space for my main dish! I ordered the fish tacos and they were very good. I'm so glad I finally checked out this place I'm definitely coming back here again.', u'author_name': u'joey santana', u'author_url': u'https://plus.google.com/110502872443880194605', u'time': 1464889937}, {u'rating': 2, u'aspects': [{u'rating': 0, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-RwwO1mYWiS4/AAAAAAAAAAI/AAAAAAAABCg/7fw5TOrRVrg/photo.jpg', u'language': u'en', u'text': u'Okay, this was my first visit and I brought my friends who were visiting the city. The reasons I chose to come here while I had a few other safe options where I've had more experiences with were - A)I wanted to show them around the nice neighbor of LES and B)the reviews were just great. In fact, all the reviews have been only 5 stars so far and you know this isn't something you'll see from even Michelin starred restaurants. Then the number of reviews are pretty low for such a highly rated restaurant, so I thought the comments were unreal or this is a real hidden gem spot. No wonder I arrived here with half excitement and half concern. 

When our table was set, we noticed some of the dishes and cups weren't clean and had to ask for replacements. Then chips were served to start with and they were damp... I was really surprised because I believe chips and guac are like the most basics of the Mexican cuisine and yet the chips here contained too much moisture to say they were freshly made. The second dish of chips, however, was okay. The food and drinks overall were mediocre - there was nothing special to notice in the freshness or quality of the ingredients placed inside tacos. The texture of fried fish was pretty soft but the composition of ingredients including the mayo-based sauce on top didn't provide any personality to the fish taco dish. My friend enjoyed the braised chicken breast but it was just okay for me - the chicken wasn't cooked tender and the sauce was bit salty. The drinks were good but not like these can't be seen in other restaurants. 

I don't think my expectation was particularly high for a five starred place but not all the experiences can be equally pleasing... Unfortunately, mine was disappointing and I hope to be entertained more for my next visit if I have a chance, so I can agree to other heartfelt reviews. ', u'author_name': u'HongJoon Jang', u'author_url': u'https://plus.google.com/112794189915322451359', u'time': 1466531334}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-XjY__pbP_Dw/AAAAAAAAAAI/AAAAAAAAF1A/pUU_6pbuN0Q/photo.jpg', u'language': u'en', u'text': u'My wife and I had our wedding dinner at La Contenta. Luis, Alex and Rigoberto were unbelievably accommodating and collaborative, from beginning to end. They were tremendously hospitable considering we flooded their restaurant with a large wedding party. And the food and drinks were superb! We couldn't have asked for a better experience. The combo of Luis' cooking, and Alex and Rigoberto's cocktails makes La Contenta the best Mexican restaurant in NYC.', u'author_name': u'Andrew Wilcox', u'author_url': u'https://plus.google.com/117280976458955250196', u'time': 1459279169}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-USl0MLQGbwI/AAAAAAAAAAI/AAAAAAAAAAA/loYJb-jzW-s/photo.jpg', u'language': u'en', u'text': u'La Contenta is an adorable, charming, scrumptious Mexican restaurant hidden on an unassuming little street in LES. Chef Luis creates authentic Mexican cuisine with a creative twist. Everything is super fresh and bursting with flavor, and the best part is it's super affordable. The guac is a must, the fish tacos are amazing, the mole and short ribs delicious, and the chile relleno is hella spicy but so worth it. Bartender Alex is a cocktail genius and has created some of my fave cocktails in the city (try the Oaxaca Express with mezcal, jalapeno and cucumber). This review made me hungry.', u'author_name': u'Debi Blizard', u'author_url': u'https://plus.google.com/105642685442593309154', u'time': 1459279454}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'language': u'en', u'text': u'10! What a pick! The Mayan cocktail, an original from La Contenta, may be the best drink I ever had. 4 cocktails and 4 apps and I took food home....$91. I cannot wait to go back. Service a 10 too!', u'author_name': u'Michael Dreher', u'author_url': u'https://plus.google.com/103862920763592875984', u'time': 1466294590}], u'formatted_phone_number': u'(212) 432-4180', u'address_components': [{u'long_name': u'102', u'types': [u'street_number'], u'short_name': u'102'}, {u'long_name': u'Norfolk Street', u'types': [u'route'], u'short_name': u'Norfolk St'}, {u'long_name': u'Lower Manhattan', u'types': [u'neighborhood', u'political'], u'short_name': u'Lower Manhattan'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10002', u'types': [u'postal_code'], u'short_name': u'10002'}]}

