USK-bBjmHFsDVTphuUDmlFdbmwPy62j8IHmCeU_7NouLlhgwIkw9r45G03mzU4SbVqf37S8Ab0Sc1xmP8uqgsJp9uQ6o222lOx-xH6_tmRNEhDNHA5ITIvr5HiPbZybiJQSGhTdzWSeIvZ-WCySW1MSsRn8_oszUg', u'width': 1536, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/106111748958700549590/photos">Raffi Asdourian</a>'], u'height': 2048}, {u'photo_reference': u'CoQBcwAAAE-1RS-sz3vJR_5m5X_JtZBptSZ0Lzyv88iFqu37K2znQc6IuSdUaPPQYcK9IatJ0OxOGNLTu1cDIVIr6irQ8vaN4Fwrcbj_NH-3cLHTeRe2eKbZ4hNgfPRe2kx6UjPmcIGWWtHySK2WdFuoPHgQ7HLRA7os1r_kDf4TNPi4UzzIEhAedhieBJ_sG2WB_HswRq1cGhTMcB9aYnvG-jZlT37s-rTihxEzPQ', u'width': 1536, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/106111748958700549590/photos">Raffi Asdourian</a>'], u'height': 2048}], u'types': [u'bar', u'restaurant', u'food', u'point_of_interest', u'establishment'], u'icon': u'https://maps.gstatic.com/mapfiles/place_api/icons/restaurant-71.png', u'name': u'Le Philosophe', u'geometry': {u'location': {u'lat': 40.7257082, u'lng': -73.9926724}, u'viewport': {u'northeast': {u'lat': 40.72592764999999, u'lng': -73.99248279999999}, u'southwest': {u'lat': 40.72563505000002, u'lng': -73.9927356}}}, u'adr_address': u'<span class="street-address">55 Bond St</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10012</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-388-0038', u'reviews': [{u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-1rk1Dn1lR9o/AAAAAAAAAAI/AAAAAAAAAII/_yv9o-0IGbc/photo.jpg', u'language': u'en', u'text': u'Solid meal here.  Sat in the cellar where it was much more quiet than the upstairs craziness.  I had the Tournedos Rossini / foie gras, madeira, black truffle.  Perfect medium rareness was achieved on the steak.  However, there was a toasted brioche on the plate which was a tad sickening.  When pressed with my fork, a ton of oil oozed out.  It was the one item on the plate that I couldn't eat.  Other than that, the rest of the food was above average and it was nice having the downstairs to ourselves and only one other table.', u'author_name': u'Jenn Fung', u'author_url': u'https://plus.google.com/101488432351785978999', u'time': 1448740868}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'language': u'en', u'text': u'Lauren recc. Kind of French. Near Gato. Pretty interior.

Bens friend Juan works here. Ben took Mel here. ', u'author_name': u'Ross Smith', u'author_url': u'https://plus.google.com/117268420027585000430', u'time': 1438123454}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-1Dy8fY3p5dI/AAAAAAAAAAI/AAAAAAAApK0/oMWwFfuUgo0/photo.jpg', u'language': u'en', u'text': u'A French bistro refined to near perfection, Le Philosphe is a charming restaurant that delivers on the classic flavors associated with comfort European food. One of the first things that grabs your attention upon walking in is the comforting wooden tones along with a mural of famous French philosophers. In terms of food, you can expect expertly crafted French staples such as frog legs with sunchoke, watercress and garlic or delightful mussels with aleppo, leeks, potatoes and crème fraîche. For my entree I went with a classic steak n frites with sauce choron and sauce bordelaise while my date raved about the duck a l’orange with turnips and pommes mousseline. The cherry on top though was our dessert, a special of the evening which consisted of lavender ice cream, meringue served over blueberry compote.

Bottom line: Quality French food that is expertly prepared and reasonably priced with delightful decor perfect for a date or family dinner.', u'author_name': u'Raffi Asdourian', u'author_url': u'https://plus.google.com/106111748958700549590', u'time': 1376418912}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-JT2sEXMLvNY/AAAAAAAAAAI/AAAAAAAAAHQ/SCvxuNISgJY/photo.jpg', u'language': u'en', u'text': u'I had read a great review on Immaculate Infatuation for this place. The aesthetic is cool and the price seemed fair. When our food came my chicken was partially raw in the center and my girlfriend's fish was not good. Good cheap wine selection though. ', u'author_name': u'matthew mclaughlin', u'author_url': u'https://plus.google.com/118368876853619864718', u'time': 1363286918}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-du-218b1K1k/AAAAAAAAAAI/AAAAAAAAkLk/njG3L1n-MJE/photo.jpg', u'language': u'en', u'text': u'The food was delicious. And they granted us free champagne and dessert because we had to wait 30 mins to get seated despite our reservation, so that was good.', u'author_name': u'Tobias Pester', u'author_url': u'https://plus.google.com/103694435294714346770', u'time': 1363531508}], u'formatted_phone_number': u'(212) 388-0038', u'address_components': [{u'long_name': u'55', u'types': [u'street_number'], u'short_name': u'55'}, {u'long_name': u'Bond Street', u'types': [u'route'], u'short_name': u'Bond St'}, {u'long_name': u'NoHo', u'types': [u'neighborhood', u'political'], u'short_name': u'NoHo'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'Ne