.99756615}, u'southwest': {u'lat': 40.73263164999999, u'lng': -73.99769554999999}}}, u'adr_address': u'<span class="street-address">22 W 8th St</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10011</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-533-2962', u'reviews': [{u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-rDtJZz3Xm-E/AAAAAAAAAAI/AAAAAAAADyg/ce81HcTzdvE/photo.jpg', u'language': u'en', u'text': u'A very small and cozy French restaurant. The food is awesome and very French. Try the goat cheese ball for sharing! Service is good and very attentive. 
The tables are extremely small and the noise level is quite high. This takes away some of the charm from this excellent little place. They have happy hour until 7pm where especially wine flights is a good choice. ', u'author_name': u'Thomas R', u'author_url': u'https://plus.google.com/106469149909314129692', u'time': 1461500564}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-b7lZ7_AhR-k/AAAAAAAAAAI/AAAAAAAAAAA/OUk9nALmiMg/photo.jpg', u'language': u'en', u'text': u'Most fun wine bar in NYC.   PHENOMENOL friendly staff, gifted at helping select you a wine, great, mostly European wine list, tasty food, fun scene. 

Been here dozens of times. ', u'author_name': u'Hank LeMieux', u'author_url': u'https://plus.google.com/113432055479654616149', u'time': 1464963277}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh3.googleusercontent.com/-1x_JPnWOPNg/AAAAAAAAAAI/AAAAAAAAAIE/FwEz-D3RTDY/photo.jpg', u'language': u'en', u'text': u'Great atmosphere for a seasoned couple or happy hour (i.e., it's loud, but bustling). We just did wine and small plates here but the dinner options looked good too. For food we got the pistachio crusted goat cheese ball (heaven!) with two Samie flights of wine (3 wines per flight). Also, ordered a bunch of crostinis. I enjoyed the little nuances like the bread in a small burlap bag, the check being brought in a French book, and that everyone woeking there spoke French. Overall, great spot to chat and engage over wine, and maybe even practice some French.', u'author_name': u'danesh j', u'author_url': u'https://plus.google.com/115220752684792993236', u'time': 1459000621}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-7NnZHHCEU00/AAAAAAAAAAI/AAAAAAAAxSs/0KXe62EBHNE/photo.jpg', u'language': u'en', u'text': u'Good escargot but the filet mignon was not. The flatbread app was solid but there's something unsettling about paying close to $15 for a handful of lettuce on a pita.', u'author_name': u'Tom W', u'author_url': u'https://plus.google.com/116838368418776396178', u'time': 1461706764}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'language': u'en', u'text': u'I had wine flights and amazing charcuterie plate , place was packed with great service. They have around 60  wines by the glass , so for me as a wine lover that is spot to be.', u'author_name': u'Marko Kalezic', u'author_url': u'https://plus.google.com/101912385695686548004', u'time': 1467174928}], u'formatted_phone_number': u'(212) 533-2962', u'address_components': [{u