], u'height': 1536}, {u'photo_reference': u'CoQBdwAAAPieCZKs1MOLH3LRxa_9jUEyDgI__w9UxN0fPFt4Kx8-kJVB3hvfbCPUYHeAS50CPTXO8WZOVSwzXBU_in7fHmPJXERyYMJ8eogWU8aX9SaUpWX-pzZx2oKiVKgkbRJz5r66TPY-t4JkpN3njZ8UFgTuPq8RgXyxPwvzWojj29xFEhAm9F7Opobj8WW76hiQItXpGhSHv6oqVK0Gu1N_9mlxXdbiKJihrg', u'width': 3840, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/102837592139129677983/photos">Richard Navarro</a>'], u'height': 2160}, {u'photo_reference': u'CoQBdwAAAN8iVMH6GniJYO54k6LsJD32WruvXv6Fp3V3GSLBaDO1OZXiNMNVm19tA_jpyMEZuwDfSG1U_NYi14F0p3h9meswYl9yEAuL5EXfgjsEbVFmlFuxPORX0hLzrpwSnvfZtq30qPNVpGGHMjbGm6CogQu1IfrWDBiNiv_-8kdaXccDEhD7Jvy2u6IcBmmtbcNln0ZbGhRyPXqVSUSZm_HTV28txbY3OCSUZw', u'width': 3456, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/102560881725907326765/photos">Kobi Rehm</a>'], u'height': 3456}, {u'photo_reference': u'CoQBcwAAACFnLh6QS6BqSbM_1gciEhdyvMY0GUSfOKEOkYP1M0fhU924I62NfdwS1AW2pSYG628ckIDvCmxEvXUMw3O-MztqJ51KJNLHECijOMqQLbP_hhfGJ2dbd-nMljSCRYzK6e-4Pl9EHcE06dH-R1FZfnsATMMvHLLxcV_ng43R2_ZXEhAyQwpkxzh9JIrEvPCzZ9PPGhQqxgxXhImzxs6ztOXRZ332Gr8vQA', u'width': 4128, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/110935058437880985407/photos">Dallas Plummer</a>'], u'height': 2322}, {u'photo_reference': u'CoQBcwAAAHjPm806Xs2Bh0ib897VP19mFBIEfMlPPYwLGg9os0mLXl09qzLhaSaaEuJIXknnw7x6L299Hj-ZtAGsSzpzcST8awZ0Tj9sHN3awrP-Gta4gu0Mm9EUlCKeHQhWJuw96RmFrayW2N7UWATByV6i_PUP87nDV1RCOGGEhmVz-8ESEhCofwq9S5ONSSIYGNJa2BnGGhT7XJmEfXbPKz2d7-tqyvqsO1rZ4A', u'width': 3958, u'html_attributions': [u'<a href="https://maps.google.com/maps/contrib/114583258099781397167/photos">venox 360</a>'], u'height': 2087}], u'types': [u'restaurant', u'food', u'point_of_interest', u'establishment'], u'icon': u'https://maps.gstatic.com/mapfiles/place_api/icons/restaurant-71.png', u'name': u'Joe's Shanghai', u'geometry': {u'location': {u'lat': 40.714655, u'lng': -73.9977528}, u'viewport': {u'northeast': {u'lat': 40.71479464999999, u'lng': -73.99770720000002}, u'southwest': {u'lat': 40.71460845000001, u'lng': -73.99776800000001}}}, u'adr_address': u'<span class="street-address">9 Pell St</span>, <span class="locality">New York</span>, <span class="region">NY</span> <span class="postal-code">10013-5134</span>, <span class="country-name">USA</span>', u'international_phone_number': u'+1 212-233-8888', u'reviews': [{u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh6.googleusercontent.com/-2A6giTsNhtQ/AAAAAAAAAAI/AAAAAAAAHVQ/bWq7k4KDNx8/photo.jpg', u'language': u'en', u'text': u'I been here a couple of times actually and never gave a review.  I remember the first time I was here couple of years back and man it was the BOMB!  Then as the years go by, whenever I'm in town I'd go get my cravings fixed and they never disappoint! (Though this last time I went, some of the dumplings broke because they were a bit dried...)

For those of you that are first timers:
First you gotta make sure to eat them when they come out of the kitchen.  Don't wait around! You come here to get the dumplings (Alright maybe the scallion pan cakes too).  But don't you rush to eat it either, cause the soup is HOT.  Take your time and slowly caress the outside layer until the skin breaks (JK just bite the damn skin people!).  As the juice come running out, proceed to drink the soup, make sure you don't burn yourself!  Also some folks likes to eat the dumplings by dipping the dumpling sauce they provide at the table.  I personally do; it gives it another kick to the dumplings.  Go ahead and give it a shot.', u'author_name': u'Kevin Zhang', u'author_url': u'https://plus.google.com/102227509989012386342', u'time': 1466293868}, {u'rating': 3, u'aspects': [{u'rating': 1, u'type': u'overall'}], u'language': u'en', u'text': u'The dumplings were delicious. Be prepared to possibly share a table with strangers. This place gets super packed so you get squeezed in wherever there is room. Luckily for our group we sat with a very nice couple that were just as surprised as we were to be sitting together. ', u'author_name': u'Tony Ramos', u'author_url': u'https://plus.google.com/114481417656838701186', u'time': 1465884943}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-lZ6ruVk7WNU/AAAAAAAAAAI/AAAAAAAA0j0/R-BrLQ1HIrc/photo.jpg', u'language': u'en', u'text': u'Holy cow their soup dumpling are amazing! You must come here and try them. Whenever friends and family visit from out of state or country and we are in the city, we always bring them to Joe's Shanghai. Nobody has ever left disappointed and they always remember Joe's. Bring cash. ', u'author_name': u'Paul Lomba', u'author_url': u'https://plus.google.com/112916857724297303809', u'time': 1465872461}, {u'rating': 5, u'aspects': [{u'rating': 3, u'type': u'overall'}], u'profile_photo_url': u'//lh4.googleusercontent.com/-eKS5weGmPJ4/AAAAAAAAAAI/AAAAAAAABD0/kG4yndb9lAM/photo.jpg', u'language': u'en', u'text': u'Came here for a light lunch after browsing what was nearby in Chinatown. Came upon Joe's Shanghai down an alleyway and was pleasantly surprised. We ordered the crab soup dumplings (xiao long bao) and the shanghai stir fried noodles, which was plenty of food. The soup dumplings were HUGE! So much soup and so big that each dumply barely fit on the soup spoons.', u'author_name': u'Denise Dang', u'author_url': u'https://plus.google.com/110288469148184652948', u'time': 1466402912}, {u'rating': 4, u'aspects': [{u'rating': 2, u'type': u'overall'}], u'profile_photo_url': u'//lh5.googleusercontent.com/-3RkOAJ8bg0g/AAAAAAAAAAI/AAAAAAAAAFo/7X-vH1vdocE/photo.jpg', u'language': u'en', u'text': u'Fast & blunt service, very tasty good-sized portions for a good price! (It was like $100 with tax for 6 people HOLLA). Ok, get the sea bass special (SO fatty and rich and delicious) and the signature pork/crab buns are pretty good too. Eh, everything we ordered was great. Even the free bowls of rice that are served with the entrees. Plus they opt for orange slices instead of fortune cookies for your dessert-that-tags-along-with-the-check so you know they're legit. GO GO GO GO GO TO JOE'S!!!', u'author_name': u'Natalie Bolton', u'author_url': u'https://plus.google.com/105633012317952447430', u'time': 1465874975}], u'formatted_phone_number': u'(212) 233-8888', u'address_components': [{u'long_name': u'9', u'types': [u'street_number'], u'short_name': u'9'}, {u'long_name': u'Pell Street', u'types': [u'route'], u'short_name': u'Pell St'}, {u'long_name': u'Chinatown', u'types': [u'neighborhood', u'political'], u'short_name': u'Chinatown'}, {u'long_name': u'Manhattan', u'types': [u'sublocality_level_1', u'sublocality', u'political'], u'short_name': u'Manhattan'}, {u'long_name': u'New York', u'types': [u'locality', u'political'], u'short_name': u'New York'}, {u'long_name': u'New York County', u'types': [u'administrative_area_level_2', u'political'], u'short_name': u'New York County'}, {u'long_name': u'New York', u'types': [u'administrative_area_level_1', u'political'], u'short_name': u'NY'}, {u'long_name': u'United States', u'types': [u'country', u'political'], u'short_name': u'US'}, {u'long_name': u'10013', u'types': [u'postal_code'], u'short_name': u'10013'}, {u'long_name': u'5134', u'types': [u'postal_code_suffix'], u'short_name': u'5134'}]}
